		<text transform="matrix(1 0 0 1 933.8057 237.4487)"><tspan x="0" y="0" fill="#010202" old-family="'WalbaumGroteskText'" font-family="'WalbaumGrot'" font-weight="500" font-size="15">Le professeur arrive en retard à l’université. </tspan><tspan x="0" y="18" fill="#010202" old-family="'WalbaumGroteskText'" font-family="'WalbaumGrot'" font-weight="500" font-size="15">Pendant la seconde Intifada (2000-2005), il lui </tspan><tspan x="0" y="36" fill="#010202" old-family="'WalbaumGroteskText'" font-family="'WalbaumGrot'" font-weight="500" font-size="15">est arrivé de mettre trois jours pour parcourir ce </tspan><tspan x="0" y="54" fill="#010202" old-family="'WalbaumGroteskText'" font-family="'WalbaumGrot'" font-weight="500" font-size="15">même trajet. Quand tout se passe « au mieux », </tspan><tspan x="0" y="72" fill="#010202" old-family="'WalbaumGroteskText'" font-family="'WalbaumGrot'" font-weight="500" font-size="15">la durée est d’environ une heure et quarante cinq </tspan><tspan x="0" y="90" fill="#010202" old-family="'WalbaumGroteskText'" font-family="'WalbaumGrot'" font-weight="500" font-size="15">minutes. Avant les accords d’Oslo (1993), il </tspan><tspan x="0" y="108" fill="#010202" old-family="'WalbaumGroteskText'" font-family="'WalbaumGrot'" font-weight="500" font-size="15">avait le droit de traverser Jérusalem et allait à </tspan><tspan x="0" y="126" fill="#010202" old-family="'WalbaumGroteskText'" font-family="'WalbaumGrot'" font-weight="500" font-size="15">Bethléem en moins de trois quart d’heure.</tspan></text>
